// Import React
import React from 'react';
// Import material-ui-next components and styling.
import { withStyles } from 'material-ui/styles';
import Drawer from 'material-ui/Drawer';
import List, { ListItem, ListItemText } from 'material-ui/List';
import Hidden from 'material-ui/Hidden';
// import third-party routing library (react-router-dom)
import { Link } from 'react-router-dom';
import Tooltip from 'material-ui/Tooltip';
import IconButton from 'material-ui/IconButton';

// Original drawer width: 240
const drawerWidth = 120;

const styles = {
  drawerPaper: {
    position: 'relative',
    width: drawerWidth,
    backgroundColor: '#33658A',
  },
  navItem: {
    marginTop: 8,
  },
};

class Sidebar extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <Hidden xsDown>
        <Drawer
          variant="permanent"
          classes={{
            paper: classes.drawerPaper,
          }}
        >
          <div className={classes.toolbar} />
          <List>
            <ListItem className={classes.navItem} component={Link} to="/home">
              <ListItemText>
                <Tooltip
                  title="Home"
                  placement="top"
                >
                  <IconButton> <i className="fas fa-home" /></IconButton>
                </Tooltip>
              </ListItemText>
            </ListItem>


            <ListItem className={classes.navItem} component={Link} to="/appointments">
              <ListItemText>
                <Tooltip
                  title="Appointments"
                  placement="top"
                >
                  <IconButton><i className="fas fa-calendar-alt" /></IconButton>
                </Tooltip>
              </ListItemText>
            </ListItem>

            <ListItem className={classes.navItem} component={Link} to="/Dealers">
              <ListItemText>
                <Tooltip
                  title="Dealers"
                  placement="top"
                >
                  <IconButton><i className="fas fa-taxi" /></IconButton>
                </Tooltip>
              </ListItemText>
            </ListItem>
            <ListItem className={classes.navItem} component={Link} to="/Dealer">
              <ListItemText>
                <Tooltip
                  title="AddCars"
                  placement="top"
                >
                  <IconButton><i className="fas fa-taxi" /></IconButton>
                </Tooltip>
              </ListItemText>
            </ListItem>

          </List>
        </Drawer>
      </Hidden>
    );
  }
}

export default withStyles(styles)(Sidebar);
